window.bookSummaryJSON = "<p><b>Just A Little Hookup</b></p> <p>Being auctioned off in the name of charity is awkward AF… until Derek’s business partner’s younger sister wins him for the weekend. He’s all hers to do with as she pleases and he can’t say he’s unhappy with the prospect. When pretend turns real, how can they concentrate on a future when someone is threatened by their relationship and will do anything to come between them?</p> <p><b>Just A Little Secret</b></p> <p>Georgia Brooks had no intention of bidding on a bachelor at the charity auction, but her sister gifts her with a <i>man</i> for her birthday weekend. And not just any man . . . Drew Daniels. A hot, gorgeous lawyer who makes her want to shed her good-girl image. Derek is all too happy to indulge Jessica’s whims Except a secret leads to Drew having to make a choice that has the potential to break Jessica’s heart..</p> <p><b>Just A Little Promise</b></p> <p>When Skye Tremont runs into her sexy former flame, Tripp Daniels, she’s reminded of the baby pact they’d made years ago… If she was single and childless by the age of thirty, he’d step in and be her baby daddy and fulfill her dream of having a child. Tripp is on board. But can he win her guarded heart?</p> <p><b>Just A Little Chase</b></p> <p>She’s in need of a fake, friendly boyfriend to charm her family. He’s the last bachelor up for auction and a grumpy, last-minute stand-in. Neither satisfies the other’s requirements but they might just be what each of them needs.</p>"; 
